tables.table_schema:
CREATE TABLE MediationOutcomes (
  id INT PRIMARY KEY,
  mediation_date DATE,
  mediator_name VARCHAR(255),
  outcome VARCHAR(50)
);

CREATE TABLE MediatorDetails (
  mediator_id INT PRIMARY KEY,
  mediator_name VARCHAR(255),
  expertise_area VARCHAR(100),
  contact_info TEXT
);

CREATE TABLE mediators (
    id SERIAL PRIMARY KEY,
    mediator_name VARCHAR(50),
    specialization VARCHAR(50),
    years_of_experience INT
);

CREATE TABLE mediation_cases (
  case_id INT PRIMARY KEY,
  case_name VARCHAR(255),
  mediator_id INT,
  case_date DATE
);

CREATE TABLE mediators (
  mediator_id INT PRIMARY KEY,
  mediator_name VARCHAR(255),
  mediator_email VARCHAR(255)
);

CREATE TABLE mediation_participants (
  participant_id INT PRIMARY KEY,
  participant_name VARCHAR(255),
  participant_role VARCHAR(50),
  case_id INT
);

CREATE TABLE mediation_outcomes (
  outcome_id INT PRIMARY KEY,
  outcome_description TEXT,
  case_id INT
);

CREATE TABLE mediation_trends (
  trend_id INT PRIMARY KEY,
  trend_name VARCHAR(255),
  trend_date DATE
);
